INSERT INTO wmi_posts VALUES("89","1","2019-12-14 22:35:28","2019-12-14 22:35:28","<!-- wp:heading -->\n<h2>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our website address is: http://wp.webmanajemen.com.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What personal data we collect and why we collect it</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Comments</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor�s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Media</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Contact forms</h3>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<script type=\"text/javascript\" src=\"https://form.jotform.me/jsform/71051612971451\"></script>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Cookies</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Embedded content from other websites</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Analytics</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Google Analystics</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We not share your privacy data</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2>WE CARE ABOUT YOUR PRIVACY</h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>WMI Global B.V., including its affiliates (�WMI�), is committed to respect your privacy and to comply with applicable data protection and privacy laws. This privacy policy (�Policy�) describes how we collect and use personal data where WMI is the data controller or where we refer to the applicability of this Policy. �Personal data� means information relating to you or another identifiable individual.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will give you additional privacy information that is specific to a product or service in Supplements to this Policy and other notices you may see while using our products or services. If there is a difference between such notices and this Policy, the notices should be considered first.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Software on your device may access your information. Our products or services may contain links to, or may be embedded within, other companies� websites and services that have privacy policies of their own. Where our products or services are embedded to products and services of our customers, we require our customers to provide necessary transparency to you. This might include linking to this Policy and the relevant Supplements, or providing the transparency in integrated and embedded notices which identify us as the service provider or controller.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>How long we retain your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What rights you have over your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Where we send your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Visitor comments may be checked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Your contact information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Email : webmanajemen@gmail.com<br>Phone : +62 856 556 7573<br>Country : Indonesia</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Additional information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>How we protect your data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Individual information will be dependent upon extra protects to guarantee this information is handled safely. For instance, we make a solid effort to guarantee information is encoded when in travel and capacity, and access to this information will be carefully constrained to a base number of people and subject to classification duties. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will make all strides sensibly important to guarantee that your information is dealt with safely and as per this Approach. Tragically, the transmission of data through the web isn\'t totally verify. In spite of the fact that we will give a valiant effort to ensure your own information, we can\'t ensure the security of your information transmitted to any of our sites; any transmission is at your own hazard. When we have gotten your data, we will utilize severe systems and security highlights to attempt to avert unapproved get to. Whenever the situation allows, encryption is utilized, both in travel and capacity. Access controls inside as far as possible who may get to data.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What data breach procedures we have in place</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Unavailable for now</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What third parties we receive data from</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>Third Parties Cookie</strong> :<br>We may likewise point from our sites to other internet providers that do utilize treats. Our installment processors, for instance, will put treats too. This is additionally the situation with multi-media administrations, and with the connections that we post on our <strong>Social media</strong> accounts.<br><br><strong>What Are Cookies ?</strong><br>Cookies are little bits of information that websites store on your computer when you visit them. They can help websites \"remember\" things about you. A website might use a cookie to store your Currency or Language preference. They are also usually required if you log in to a website.<br><br><strong>Various third-party cookies in our websites</strong> ?<br>1. Google Analystics<br>2. Google Adsense<br>3. Google Recaptcha<br>4. Google APIs</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<center>\n<b>Are third party cookies enabled ?</b><br>\nthird party cookies are <span id=\"result\"></span>\n</center>\n<script type=\"text/javascript\">\nvar CookieName = \"ThirdPartyCookies\";\ndocument.cookie = CookieName+\"=yes;\";\nif(document.cookie.indexOf(CookieName) == -1) {\n  document.getElementById(\'result\').innerHTML = \'<b style=\"color:red\">Not supported</b>\';\n} else {\ndocument.getElementById(\'result\').innerHTML = \'<b style=\"color:green\">Supported</b>\';\n}\n</script>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What automated decision making and/or profiling we do with user data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We only use email and name of your Google Accounts for identify cookie auth from our website hooks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Information We Automatically Collect</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We automatically collect certain information to help us understand how our users use the Services (which we will refer to in this Privacy Policy collectively as \"Usage Data\"). For example, each time you visit the Services we may automatically collect your IP address, browser and computer type, access time, the Web page you came from, the URL you go to next, and the Web page(s) that you access during your visit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will use such Usage Data to diagnose problems with our servers and software, to administer the Services, and to gather demographic information. Our third-party advertising networks and servers will also provide us reports that will tell us how many ads were presented and clicked on the Services in a manner that does not identify personally any individual.</p>\n<!-- /wp:paragraph -->","Privacy Policy","","inherit","closed","closed","","3-revision-v1","","","2019-12-14 22:35:28","2019-12-14 22:35:28","","3","http://agc.io/2019/12/14/3-revision-v1.html","0","revision","","0");
INSERT INTO wmi_posts VALUES("90","1","2019-12-14 22:36:48","2019-12-14 22:36:48","<!-- wp:heading -->\n<h2>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our website address is: http://wp.webmanajemen.com.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What personal data we collect and why we collect it</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Comments</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor�s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Media</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Contact forms</h3>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<script type=\"text/javascript\" src=\"https://form.jotform.me/jsform/71051612971451\"></script>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Cookies</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Embedded content from other websites</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Analytics</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Google Analystics</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We not share your privacy data</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2>WE CARE A